{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/niwaan/google-data-analytics-course-case-study-no-1?scriptVersionId=92169746\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"dd8d7792","metadata":{"papermill":{"duration":0.083324,"end_time":"2022-04-05T12:43:11.39986","exception":false,"start_time":"2022-04-05T12:43:11.316536","status":"completed"},"tags":[]},"source":["This file is a part of Google Data Analytics Professional Certification course No. 8\n","This file was written by Niwaan Ponpunthin\n","\n","# Background\n","Suppose I work for a fictious bike-sharing company named \"Cyclistic\". And Ms. Lily Moreno, the director of marketing, believes that maximum membership conversion is the key to company's future success and she wants to team to back her up with data. Thus, she assigned me to answer the business question whether the annual members and casual riders use Cyclistic bikes differently. \n","# Stakeholders\n","1. Ms. Lily Moreno\n","2. Cyclistic marketing analytics team\n","\n","# Data Source\n","This data is originated from the divvy bike company under the Divvy Data License Agreement.\n","Please visit: https://divvy-tripdata.s3.amazonaws.com/index.html for the raw data\n","\n","This data fits the ROCCC concept which consists of\n","1. Relevant: **I assumed that this data is from the Cyclistic company**\n","2. Original: **I assumed that this data is from the Cyclistic company**\n","3. Comprehensive: this data covers essential parts of cycling data except for the riding distances.\n","4. Current: this data was just updated on March 3, 2022.\n","5. Cited: this data has been cited by many Google Data Analytics students throughout their study cases.\n","\n","# Data Problems\n","1. The data did not include the riding distance in each bike sessions. So the possible way is to calculate the displacements between starting locations and the end locations.\n","2. There is no pseudo-ID for each bike member or casual rider. So I cannot track the behavior of each bike member compared with the casual riders. The best I could do is to compare the biking between two groups.\n"]},{"cell_type":"markdown","id":"736c2bdf","metadata":{"papermill":{"duration":0.079733,"end_time":"2022-04-05T12:43:11.559379","exception":false,"start_time":"2022-04-05T12:43:11.479646","status":"completed"},"tags":[]},"source":["# Install Packages"]},{"cell_type":"code","execution_count":1,"id":"b9525df2","metadata":{"execution":{"iopub.execute_input":"2022-04-05T12:43:11.728802Z","iopub.status.busy":"2022-04-05T12:43:11.723722Z","iopub.status.idle":"2022-04-05T12:45:06.071203Z","shell.execute_reply":"2022-04-05T12:45:06.06935Z"},"papermill":{"duration":114.432411,"end_time":"2022-04-05T12:45:06.07146","exception":false,"start_time":"2022-04-05T12:43:11.639049","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["install.packages(\"tidyverse\")    #package for cleaning data\n","install.packages(\"SpatialEpi\")   #package for converting latitude-longitude to grid coordinates\n","install.packages(\"ggplot2\")      #package for plotting results\n","install.packages(\"lubridate\")    #package for dealing with dates"]},{"cell_type":"markdown","id":"add4ef57","metadata":{"papermill":{"duration":0.083487,"end_time":"2022-04-05T12:45:06.246146","exception":false,"start_time":"2022-04-05T12:45:06.162659","status":"completed"},"tags":[